import React from "react";
import { Routes, Route } from "react-router-dom";
import Register from "./components/auth/Register";
import Login from "./components/auth/Login";
import CreateProject from "./components/project/CreateProject";
import MyProjects from "./components/project/MyProjects";
import FreelancerProfile from "./components/project/FreelancerProfile";
import AdminPanel from "./components/admin/AdminPanel";
import Navbar from "./components/layout/Navbar";
import Home from "./components/pages/Home";
import Footer from "./components/layout/Footer"; // Uncomment if you want to use Footer
import './App.css'; // Uncomment if you have custom styles for App

function App() {
  return (
    <>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} /> {/* FIXED */}
        <Route path="/register" element={<Register />} />
        <Route path="/create-project" element={<CreateProject />} />
        <Route path="/my-projects" element={<MyProjects />} />
        <Route path="/freelancer/:id" element={<FreelancerProfile />} />
        <Route path="/admin" element={<AdminPanel />} />
      </Routes>
      <Footer />
    </>
  );
}

export default App;
